Text:
“We are each other's harvest; 
we are each other's business; 
we are each other's magnitude and bond.” 

― Gwendolyn Brooks #BHM

In November, Georgia made history and turned blue. In a few days, they have the chance to do it again by electing @Ossoff and @ReverendWarnock.

@GeorgiaDemocrat needs our help now to protect and get out the vote. Please chip in today if you can: 
https://t.co/qvkpfEMNnO

If Trump fails to sign the relief bill millions will lose their extended unemployment &amp; won’t have the protection of the eviction moratorium. 

States won’t receive critical funds to distribute the vaccine.

@realdonaldtrump: sign the bill.

@senatemajldr: pass $2,000 checks now.

Tonight I'm filled with hope for our nation's future.

@JoeBiden and @KamalaHarris will unite, strengthen, and heal this country.

As dark as these past four years have been, despair will not have the last word.
